import React from 'react';

function Footer() {
  return (
    <footer className="text-center text-lg-start text-white" style={{ backgroundColor: '#1c2331' }}>
      <section className="d-flex justify-content-between p-4" style={{ backgroundColor: '#6351ce' }}>
        <div className="me-5">
          <span>Get connected with us on social networks:</span>
        </div>
        <div>
          <a href="/" className="text-white me-4"><i className="fab fa-facebook-f"></i></a>
          <a href="/" className="text-white me-4"><i className="fab fa-twitter"></i></a>
          <a href="/" className="text-white me-4"><i className="fab fa-google"></i></a>
          <a href="/" className="text-white me-4"><i className="fab fa-instagram"></i></a>
          <a href="/" className="text-white me-4"><i className="fab fa-linkedin"></i></a>
          <a href="/" className="text-white me-4"><i className="fab fa-github"></i></a>
        </div>
      </section>
      <section className="container text-center text-md-start mt-5">
        <div className="row mt-3">
          {/* Define separate components for each section */}
          <FooterColumn title="Company name" content="Here you can use rows and columns to organize your footer content. Lorem ipsum dolor sit amet, consectetur adipisicing elit." />
          <FooterColumn title="Products" links={['MDBootstrap', 'MDWordPress', 'BrandFlow', 'Bootstrap Angular']} />
          <FooterColumn title="Useful links" links={['Your Account', 'Become an Affiliate', 'Shipping Rates', 'Help']} />
          <FooterContactColumn />
        </div>
      </section>
      <div className="text-center p-3" style={{ backgroundColor: 'rgba(0, 0, 0, 0.2)' }}>
        © 2020 Copyright:
        <a className="text-white" href="https://mdbootstrap.com/">MDBootstrap.com</a>
      </div>
    </footer>
  );
}

// Define separate functional components for better organization
function FooterColumn({ title, content, links }) {
  return (
    <div className="col-md-3 col-lg-4 col-xl-3 mx-auto mb-4">
      <h6 className="text-uppercase fw-bold">{title}</h6>
      <hr className="mb-4 mt-0 d-inline-block mx-auto" style={{ width: '60px', backgroundColor: '#7c4dff', height: '2px' }} />
      {content && <p>{content}</p>}
      {links && links.map((link, index) => <p key={index}><a href="#!" className="text-white">{link}</a></p>)}
    </div>
  );
}

function FooterContactColumn() {
  return (
    <div className="col-md-4 col-lg-3 col-xl-3 mx-auto mb-md-0 mb-4">
      <h6 className="text-uppercase fw-bold">Contact</h6>
      <hr className="mb-4 mt-0 d-inline-block mx-auto" style={{ width: '60px', backgroundColor: '#7c4dff', height: '2px' }} />
      <p><i className="fas fa-home mr-3"></i> New York, NY 10012, US</p>
      <p><i className="fas fa-envelope mr-3"></i> info@example.com</p>
      <p><i className="fas fa-phone mr-3"></i> + 01 234 567 88</p>
      <p><i className="fas fa-print mr-3"></i> + 01 234 567 89</p>
    </div>
  );
}

export default Footer;
